import { useEffect, useState } from "react"

export const StaffGreeting = () => {

    const [users, setUsers] = useState([])
    const windowAlert = () => {
        alert(`Welcome ${users.fullName}!`)
    }

    useEffect(() => {

        fetch('http://localhost:8088/users')
            .then(response => response.json())
            .then((userInfo => {
                setUsers(userInfo)
            }))

            .then(() => {
                windowAlert()
            }
            )
    },
        [])

}
